Tenho 55 anos ;
Fiz duas pontes de Safena e uma mamária em agosto de 2019;
Tive hospitalizado em fevereiro 2020 por problemas renais ( urinando Sangue );
Estou me tratando com urologista, em abril 2020 consulta, Setembro exames de Sangue , raio-x e eletrocardiograma que acusou Bradicardia com 54 bpm;
Outubro anecessista ok para cirúrgia que foi remarcada para janeiro 2021;
Dezembro 2020 exames de Cintilografia através da Medicina Nuclear.
Estou incluso no grupo de risco ou não?

